import React from 'react'
import styles from "../css/Login.module.css"

const Login = () => {
  return (
    <div className={styles.LoginWrap}>
      <form action="" className={styles.LoginFormWrap}>
        <input type="email" className={styles.LoginFormEmail} />
      </form>
    </div>
  )
}

export default Login
